import React from 'react';
import './ImageGallery.css';

const TESTIMONIALS = [
  { company: 'Nordic Harbor AB', author: 'Lina Berg', title: 'VD', excerpt: 'One Redovisning hjälpte oss att få struktur i ekonomin och frigjorde tid för oss att fokusera på tillväxt.' },
  { company: 'Västkust Energi', author: 'Erik Holm', title: 'Ekonomichef', excerpt: 'Smidig kommunikation, snabba uppföljningar och en tydlig rådgivning som gjorde skillnad från dag ett.' },
  { company: 'Skog & Stad Fastigheter', author: 'Maja Lind', title: 'Styrelseordförande', excerpt: 'Professionalitet och tillgänglighet — vi får alltid snabb hjälp när det behövs.' },
  { company: 'Luma Tech Solutions', author: 'Oscar Nilsson', title: 'Grundare', excerpt: 'Deras digitala arbetsflöden och personliga support har förenklat vår löpande administration.' },
];

export default function ImageGallery(){
  return (
    <div className="testimonials-bleed-full">
      <section className="testimonials" aria-labelledby="testimonials-heading">
      <div className="testimonials-hero">
        <small className="eyebrow">GREAT ACCOUNTING SWEDEN AB</small>
        <h2 id="testimonials-heading">Vad säger våra kunder</h2>
        <p className="sub">Vi är otroligt stolta över alla våra nöjda kunder och anstränger oss lite extra för att ni ska känna er väl omhändertagna</p>
  </div>
      
  <div className="testimonials-grid">
        {TESTIMONIALS.map((t, i) => (
          <article key={i} className="testimonial-card">
            <div className="card-inner">
              <h3 className="card-company">{t.company}</h3>
              <small className="card-author">Av {t.author}{t.title ? `, ${t.title}` : ''}</small>
              <h4 className="card-heading">Om samarbetet</h4>
              <p className="card-text">{t.excerpt}</p>
              <a className="card-cta" href="/testimonials">Läs mer</a>
            </div>
          </article>
        ))}
      </div>
    </section>
    </div>
  );
}
